{"3": ["Красивые, на фото большие, когда получили , оказались маленькими... жаль,поэтому отказ, прошу не снижать процент выкупа.", "2020-01-31T12:17:38.832608096Z", "серебристый", "0", 0, 1, 3, "Запонки SILVERMEN", "SILVERMEN"], "4": ["Очень красивые серебряные запонки, только вот как всегда обидно было что коробка была затертая ужасно, а я брала на подарок и так не удобно было капец,", "2019-09-23T05:13:28.629721149Z", "серебристый", "0", 2, 0, 4, "Запонки SILVERMEN", "SILVERMEN"], "6": ["Взяла в подарок мужу на Новый год. Выглядят запонки очень достойно. Коробка не мятая, не затертая отделана бархатом внутри. Мне всё понравилось. Спасибо", "2019-12-24T15:54:55.065159908Z", "серебристый", "0", 3, 0, 5, "Запонки SILVERMEN", "SILVERMEN"], "11": ["Заказал три пары для подарков на работе. \r\nПо качеству - все три в нормальном состоянии, без царапин и пятен, \r\nпо дизайну -  эффектные, цене - соответствуют.\r\nПришли в футлярах.", "2019-01-16T18:39:43.271760087Z", "серебристый", "0", 1, 0, 5, "Запонки SILVERMEN", "SILVERMEN"], "14": ["Запонки-то красивые. Но посередине, где фианиты, серебро облезло. И виден желтый металл", "2018-11-25T20:10:56.870063986Z", "серебристый", "0", 1, 0, 2, "Запонки SILVERMEN", "SILVERMEN"], "15": ["Хорошие запонки) и размер хорош. Но взяла другие)", "2018-09-10T14:34:18.373422473Z", "серебристый", "0", 1, 0, 5, "Запонки SILVERMEN", "SILVERMEN"]}
